# check and download ad template from server.
def advertisement():
    try:
        response = requests.get(AD_TEMP_URL, timeout=5)

        if response.status_code == 200:
            soup = BeautifulSoup(response.text, 'html.parser')

            server_image_names = []
            for link in soup.find_all('a'):
                href = link.get('href')
                if href.endswith(('.jpg', '.jpeg', '.png')):
                    server_image_names.append(href)

        for item in os.listdir(advertisement_folder):
            if item.endswith(('.jpg', '.jpeg', '.png')):
                
                if item not in server_image_names:
                    os.remove(os.path.join(advertisement_folder, item))
                    
                elif item in server_image_names:
                    server_image_names.remove(item)

        for image in server_image_names:
            response = requests.get(AD_TEMP_URL+image, stream=True, timeout=5)
            with open(os.path.join(advertisement_folder, image), "wb") as file:
                for chunk in response.iter_content(chunk_size=8192):
                    file.write(chunk)

    except Exception:
        None
