def new_update_changes():
    def bus_uid_column_add():
        try:
            connection = sqlite3.connect(os.path.join(config_folder, cred.auth_db_name))
            cursor = connection.cursor()

            cursor.execute("PRAGMA table_info(soft_reg)")
            columns = cursor.fetchall()
            if not any(column[1] == 'bus_uid' for column in columns):
                cursor.execute("ALTER TABLE soft_reg ADD bus_uid varchar(50)")

            connection.commit()
        except Exception:
            None
        finally:
            connection.close()

    def checkpoint_file_create():
        # checkpoint file write
        system_date = str(datetime.now().date())
        binary = system_date.encode("utf-8")
        b64encode = base64.b64encode(binary).decode("utf-8")
        str_1 = b64encode.replace("=", "")
        str_2 = str_1.swapcase()
        encrypted_system_date =  str_2[::-1]
        # Create the file with the current system date
        with open(".checkpoint", 'w') as file:
            file.write(encrypted_system_date)
        # Set the file attribute to hidden
        FILE_ATTRIBUTE_HIDDEN = 0x02
        ctypes.windll.kernel32.SetFileAttributesW(".checkpoint", FILE_ATTRIBUTE_HIDDEN)

    def sys_hash_and_soft_version_update():
        try:
            remote_connection = mysql.connector.connect(
                host = cred.host,
                user = cred.user,
                password = cred.password,
                database = cred.database
            )
            remote_cursor = remote_connection.cursor()

            result = subprocess.run(['wmic', 'csproduct', 'get', 'uuid'], capture_output=True, text=True)
            uuid = result.stdout.strip().split('\n')[-1].strip()
            sys_hash = hashlib.sha256(uuid.encode()).hexdigest()

            local_connection = sqlite3.connect(os.path.join(config_folder, cred.auth_db_name))
            local_cursor = local_connection.cursor()

            local_cursor.execute("select bus_contact from soft_reg")
            for line in local_cursor.fetchall():
                local_contact = line[0]
                remote_cursor.execute("update soft_reg set sys_hash=%s, soft_version=%s where bus_contact=%s", (sys_hash, version, local_contact))
            
            remote_connection.commit()
            remote_connection.close()
        except Exception:
            None


    new_update_filename = f".update_{version}"
    if not os.path.exists(new_update_filename):
        sys_hash_and_soft_version_update()
        bus_uid_column_add()
        checkpoint_file_create()

        # write the update file
        with open(new_update_filename, "w") as f:
            f.write(version)
        # Set the file attribute to hidden
        FILE_ATTRIBUTE_HIDDEN = 0x02
        ctypes.windll.kernel32.SetFileAttributesW(new_update_filename, FILE_ATTRIBUTE_HIDDEN)
        # delete others update file
        for file in os.listdir():
            if file.startswith(".update") and file!=new_update_filename:
                os.remove(file)
