def checkpoint_entry(page):
    def encrypt(data):
        binary = data.encode("utf-8")
        b64encode = base64.b64encode(binary).decode("utf-8")
        str_1 = b64encode.replace("=", "")
        str_2 = str_1.swapcase()
        return str_2[::-1]

    def decrypt(data):
        str_2 = data[::-1]
        str_1 = str_2.swapcase()
        no_pad = len(str_1)%3
        b64encode = (str_1 + str(no_pad*"=")).encode("utf-8")
        binary = base64.b64decode(b64encode)
        return binary.decode()

    file_path = ".checkpoint"
    system_date = datetime.now().date()

    if not os.path.exists(file_path):
        return "CHECKPOINT ERROR"
    
    else:
        try:
            with open(file_path, 'r') as file:
                decrypted_data = decrypt(file.read().strip())
                last_known_date = datetime.strptime(decrypted_data, "%Y-%m-%d").date()

            if last_known_date > system_date:
                return "SYSTEM DATE ERROR"
            else:
                FILE_ATTRIBUTE_NORMAL = 0x80
                ctypes.windll.kernel32.SetFileAttributesW(file_path, FILE_ATTRIBUTE_NORMAL)
                with open(file_path, 'w') as file:
                    encrypted_data = encrypt(str(system_date))
                    file.write(encrypted_data)

                FILE_ATTRIBUTE_HIDDEN = 0x02
                ctypes.windll.kernel32.SetFileAttributesW(file_path, FILE_ATTRIBUTE_HIDDEN)
                return "LOGIN"
        except Exception:
            return "CHECKPOINT ERROR"
